contracts/ProductRegistry.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.28;

contract ProductRegistry {
    struct Product {
        string productId;
        string name;
        string price;
        string attributes;
        string isBidding;
        string isNegotiable;
        string owner;
        string createdAt;
    }

    mapping(string => Product) public products;

    event ProductRegistered(Product product);

    function registerProduct(Product calldata newProduct) external {
        products[newProduct.productId] = newProduct;
        emit ProductRegistered(newProduct);
    }
}

contracts/ReceiptBook.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

contract ReceiptBook {
    struct Receipt {
        string transactionId;
        string productId;
        string buyer;
        string seller;
        string amount;
        string meetUpLocation;
        string scheduledMeetUpAt;
        string createdAt;
        string status;
    }

    mapping(string => Receipt) public receipts;

    // Emit the full struct as a single argument (ABI encodes it cleanly)
    event ReceiptIssued(Receipt receipt);

    function issueReceipt(Receipt calldata newReceipt) external {
        // Store the receipt in the mapping
        receipts[newReceipt.transactionId] = newReceipt;

        // Emit the struct as the event payload
        emit ReceiptIssued(newReceipt);
    }
}

contracts/ReviewAndRating.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

contract ReviewAndRating {
    struct Review {
        string reviewer;
        string reviewee;
        string transactionId;
        string comment;
        string rating; // 1â€“5
        string createdAt;
    }

    mapping(string => Review) public productReviews;

    // Option 1: Emit the entire struct (compact, clean)
    event ReviewSubmitted(string transactionId, Review review);

    function submitReview(Review calldata newReview) external {
        // Store the review
        productReviews[newReview.transactionId] = newReview;

        // Emit event with productId and struct
        emit ReviewSubmitted(newReview.transactionId, newReview);
    }
}

